import React, { useState } from 'react';
import './App.css'
import Listitem from './listItems/list_information';


function App() {

  const [todos, setTodos] = useState([
    {
      id: 1,
      text: "Nod JS",
      isCompleted: false
    },
    {
      id: 2,
      text: "Work",
      isCompleted: false

    },
    {
      id: 3,
      text: "Nod JS",
      isCompleted: false
    }
  ])

  return (
    <div className='wrapper'>
      <div>
        <div className="todo_App">
          <Listitem todos={todos} onChange={(newTodo) => {
            setTodos(todos.map((todo) => {
              if (todo.id === newTodo.id) {
                return newTodo
              } else {
                return todo
              }
            }))
          }} />

        </div>
        <input></input>

      </div>
    </div>


  )
}

export default App;
